import React, { useState, useEffect } from "react"
import '../App.css'
import Table from 'react-bootstrap/Table';
import axios from "axios";


const ShowSelectedRestaurant = () => {

  const [data, setData] = useState([]);


  useEffect(() => {
    axios
      .get(`http://localhost:8080/restaurant/api/v1/getSelectedRestaurant`)
      .then((res) => {
        setData(res.data);
      })
      .catch((err) => console.log(err));
  }, []);


if(data.statusCode ==200) {
  return (
    <Table striped bordered hover size="sm">
      <thead>
            <tr>
                <th>Restaurant Name</th>
                 <th>Restaurant AddedBy</th>
                 <th>sessionId</th>
            </tr>
        </thead>
        <tbody>
            {
                 <tr key={data.restaurantName}>
                 <td>{data.restaurantName}</td>
                 <td>{data.restaurantAddedBy}</td>
                 <td>{data.sessionId}</td>
               </tr>
            }
        </tbody>
    </Table>
  );
} else {
  return (
    <Table striped bordered hover size="sm">
      <thead>
        <tr>
          <th>Message</th>
        </tr>
      </thead>

      <tbody>
        {
          <tr key={data.message}>
            <td>{data.message}</td>
          </tr>
        }
      </tbody>
    </Table>
  );
}
}
export default ShowSelectedRestaurant;
